import React from 'react'
import Movie from './Movie'
export default function Movies(props) {
    const {movies} = props
  return (
    <div className='movies'>
        {
            movies.map(movie=>(
                <div className="container">    
                    <div className="row">
                        <Movie key={movie.imdbID} {...movie}/>
                    </div>
                </div>
            ))
        }
    </div>
  )
}
